import {
  GET_ERRORS,
  RECEIVE_CURRENT_USER
} from '../util/session_util';

export default (state = [], action) => {
  Object.freeze(state);
  switch(action.type) {
    case GET_ERRORS:
      return action.payload;
    case RECEIVE_CURRENT_USER:
      return [];
    default:
      return state;
  }
};
